import React, { useState } from 'react'

function Signin() {
    const [id, setId] = useState("")
    const [mdp, setMdp] = useState("")
    const[confirm, setConfirm] = useState("")

    return (
        (mdp !== confirm) ? alert("Les mots de passe ne correspondent pas") :
        <div className="signin">
            <h1>Register Account</h1>
            <form method="POST" action="">
                {/* <label for="username">Username</label> */}
                <input type="text" name="username" id="username" placeholder="Usename" onChange={setId}/>
                <br/>
                {/* <label for="password">Mot de passe</label> */}
                <input type="password" name="password" id="password" placeholder="Password" onChange={setMdp}/>
                <br/>
                {/* <label for="confirm">Confirm mot de passe</label> */}
                <input type="password" name="confirm" id="confirm" placeholder="Confirm Password" onChange={setConfirm}/>
                <br/>
                <input type="submit" value="Register"/>
                <input type="submit" value="Annuler"/>
                <br/>
            </form>
        </div>);
}

export default Signin
